# Route to display list of teams
@app.route('/teams')
def index():
  # Connect to database
  conn = get_db_connection()

  # Fetch teams as dictionaries
  cursor = conn.cursor()
  cursor.execute('SELECT * FROM Teams')
  teams = cursor.fetchall()

  # Close connection
  conn.close()

  # Convert teams to list of dictionaries
  teams_list = [dict(row) for row in teams]  # Create dictionaries from each row

  # Return JSON response
  return jsonify(teams=teams_list)

