def get_team_info(team_name):
    # Establish a connection to the SQLite database
    conn = sqlite3.connect('nfl_salary_cap.db')
    conn.row_factory = sqlite3.Row  # This enables column access by name
    cur = conn.cursor()

    # SQL to fetch team details
    cur.execute('''
        SELECT t.TeamID, t.TeamName, t.TeamLocation, t.TeamOwner, t.Logo,
               p.Name as PlayerName, p.Position, c.Salary
        FROM Teams t
        LEFT JOIN Players p ON t.TeamID = p.TeamID
        LEFT JOIN Contracts c ON p.PlayerID = c.PlayerID
        WHERE t.TeamName = ?
    ''', (team_name,))
    
    # Fetch all results
    results = cur.fetchall()

    # Check if team was found
    if not results:
        return jsonify({'error': 'Team not found'}), 404

    # Structure the results into a more readable format
    team_info = {
        'TeamID': results[0]['TeamID'],
        'TeamName': results[0]['TeamName'],
        'TeamLocation': results[0]['TeamLocation'],
        'TeamOwner': results[0]['TeamOwner'],
        'Logo': results[0]['Logo'],
        'Players': []
    }

    # Append player details
    for row in results:
        if row['PlayerName']:  # There could be teams with no players
            team_info['Players'].append({
                'Name': row['PlayerName'],
                'Position': row['Position'],
                'Salary': row['Salary']
            })

    conn.close()

    return jsonify(team_info)
def insert_contract_data(df):
    # Establish connection to SQLite database
    conn = sqlite3.connect('nfl_salary_cap.db')
    cur = conn.cursor()

    # Iterate through the DataFrame and insert/update data in the Contracts table
    for _, row in df.iterrows():
        # Get PlayerID based on the player's name
        cur.execute("SELECT PlayerID FROM Players WHERE Name = ?", (row['PlayerName'],))
        player_id = cur.fetchone()
        
        if player_id:
            # Check if contract already exists for player, then update or insert
            cur.execute("SELECT ContractID FROM Contracts WHERE PlayerID = ?", (player_id[0],))
            contract = cur.fetchone()
            if contract:
                cur.execute("UPDATE Contracts SET Salary = ? WHERE ContractID = ?", (row['Salary'], contract[0]))
            else:
                cur.execute("INSERT INTO Contracts (PlayerID, Salary) VALUES (?, ?)", (player_id[0], row['Salary']))
        else:
            # Optionally handle the case where the player is not found
            print(f"No player found with the name {row['PlayerName']}")

    conn.commit()
    conn.close()

@app.route('/insert_contracts', methods=['POST'])
def upload_contracts_file():
    
    # Use Pandas to read the Excel file
    df = pd.read_excel('NFL_Salary_Data.xlsx')

    # Optionally, validate the DataFrame to ensure it contains necessary columns
    if not all(col in df.columns for col in ['PlayerName', 'Salary']):
        return jsonify({'error': 'Missing one or more required columns (PlayerName, Salary)'}), 400

    # Insert data into the database
    insert_contract_data(df)

    return jsonify({'message': 'Contracts updated successfully'}), 200

