@app.route('/teams/<team_name>/players', methods=['GET'])
def get_team_players(team_name):
    # Establish a connection to the SQLite database
    conn = sqlite3.connect('nfl.db')
    conn.row_factory = sqlite3.Row  # This enables column access by name
    cur = conn.cursor()

    # SQL JOIN to fetch players for a specific team using the team name directly
    cur.execute('''
        SELECT p.PlayerID, p.Name, p.Position, p.Salary, p.TeamID
        FROM Players AS p
        INNER JOIN Teams AS t ON p.TeamID = t.TeamID
        WHERE t.TeamName = ?
    ''', (team_name,))

    players = cur.fetchall()

    if not players:
        conn.close()
        return jsonify({'error': 'No players found for the specified team or team does not exist'}), 404

    # Transform the data into a list of dictionaries
    players_list = [dict(player) for player in players]

    conn.close()

    return jsonify({'team': team_name, 'players': players_list})

def insert_player_data(df):
    # Establish connection to SQLite database
    conn = sqlite3.connect('nfl_salary_cap.db')
    cur = conn.cursor()

    # Iterate through the DataFrame and insert data into the Players table
    for _, row in df.iterrows():
        cur.execute('''
            INSERT INTO Players (Name, Position, TeamID)
            SELECT ?, ?, ?, TeamID FROM Teams WHERE TeamName = ?
        ''', (row['Name'], row['Position'], row['Team']))
    conn.commit()
    conn.close()

